import React from 'react';
import { 
    AppBar, 
    Toolbar, 
    Typography, 
    Button, 
    Box,
    IconButton,
    useTheme,
    useMediaQuery,
    Drawer
} from '@mui/material';
import { useNavigate, useLocation } from 'react-router-dom';
import { useAuth } from '../../context/AuthContext';
import DashboardIcon from '@mui/icons-material/Dashboard';
import CalendarMonthIcon from '@mui/icons-material/CalendarMonth';
import LogoutIcon from '@mui/icons-material/Logout';
import LoginIcon from '@mui/icons-material/Login';
import PersonAddIcon from '@mui/icons-material/PersonAdd';
import MenuIcon from '@mui/icons-material/Menu';
import ChevronLeftIcon from '@mui/icons-material/ChevronLeft';

function Navbar({ isCollapsed, setIsCollapsed }) {
    const navigate = useNavigate();
    const location = useLocation();
    const { isAuthenticated, logout } = useAuth();
    const theme = useTheme();
    const isMobile = useMediaQuery(theme.breakpoints.down('sm'));

    const handleLogout = () => {
        logout();
        navigate('/login');
    };

    const isActive = (path) => {
        return location.pathname === path;
    };

    const navButton = {
        my: 1,
        width: '100%',
        borderRadius: 0,
        color: '#2E2E2E',
        background: 'transparent',
        transition: 'all 0.2s ease-in-out',
        fontWeight: 600,
        justifyContent: isCollapsed ? 'center' : 'flex-start',
        textAlign: 'left',
        pl: isCollapsed ? 0 : 3,
        pr: isCollapsed ? 0 : 2,
        minWidth: 0,
        '& .MuiButton-startIcon': {
            margin: isCollapsed ? 0 : undefined,
        },
        '&:hover': {
            background: 'rgba(0, 122, 255, 0.08)',
            color: '#007AFF',
        },
        '&.active': {
            background: 'rgba(50, 205, 50, 0.12)',
            color: '#32CD32',
        }
    };

    return (
        <Box
            sx={{
                width: isCollapsed ? 64 : 220,
                height: '95vh',
                position: 'fixed',
                top: 0,
                left: 0,
                bgcolor: '#FFFFFF',
                color: '#2E2E2E',
                borderRight: '1px solid #E0E6ED',
                boxShadow: '2px 0 8px 0 rgba(0,0,0,0.04)',
                display: 'flex',
                flexDirection: 'column',
                alignItems: 'stretch',
                zIndex: 1200,
                py: 3,
                transition: 'width 0.2s cubic-bezier(.4,0,.2,1)',
            }}
        >
            <Box sx={{ display: 'flex', justifyContent: isCollapsed ? 'center' : 'flex-end', alignItems: 'center', mb: 2, px: isCollapsed ? 0 : 1 }}>
                <IconButton onClick={() => setIsCollapsed((prev) => !prev)} sx={{ borderRadius: 0 }}>
                    {isCollapsed ? <MenuIcon /> : <ChevronLeftIcon />}
                </IconButton>
            </Box>
            <Box sx={{ flex: 1, display: 'flex', flexDirection: 'column', alignItems: 'stretch', gap: 0, mt: 0, mb: 0 }}>
                {isAuthenticated ? (
                    <>
                        <Button 
                            color="inherit" 
                            startIcon={<DashboardIcon />} 
                            onClick={() => navigate('/dashboard')} 
                            sx={{
                                ...navButton,
                                ...(isActive('/dashboard') && {
                                    background: 'rgba(0, 122, 255, 0.08)',
                                    color: '#007AFF',
                                })
                            }}
                        >
                            {!isCollapsed && 'Dashboard'}
                        </Button>
                        <Button 
                            color="inherit" 
                            startIcon={<CalendarMonthIcon />} 
                            onClick={() => navigate('/calendar')} 
                            sx={{
                                ...navButton,
                                ...(isActive('/calendar') && {
                                    background: 'rgba(50, 205, 50, 0.12)',
                                    color: '#32CD32',
                                })
                            }}
                        >
                            {!isCollapsed && 'Calendar'}
                        </Button>
                        <Button
                            color="inherit"
                            startIcon={<LogoutIcon />}
                            onClick={handleLogout}
                            sx={{
                                ...navButton,
                                mt: 'auto',
                                background: 'rgba(0, 122, 255, 0.06)',
                                color: '#007AFF',
                                '&:hover': {
                                    background: 'rgba(50, 205, 50, 0.12)',
                                    color: '#32CD32',
                                }
                            }}
                        >
                            {!isCollapsed && 'Logout'}
                        </Button>
                    </>
                ) : (
                    <>
                        <Button
                            color="inherit"
                            startIcon={<LoginIcon />}
                            onClick={() => navigate('/login')}
                            sx={{
                                ...navButton,
                                color: '#007AFF',
                                background: 'rgba(0, 122, 255, 0.06)',
                                '&:hover': {
                                    background: 'rgba(50, 205, 50, 0.12)',
                                    color: '#32CD32',
                                }
                            }}
                        >
                            {!isCollapsed && 'Login'}
                        </Button>
                        <Button
                            color="inherit"
                            startIcon={<PersonAddIcon />}
                            onClick={() => navigate('/register')}
                            sx={{
                                ...navButton,
                                color: '#32CD32',
                                background: 'rgba(50, 205, 50, 0.10)',
                                '&:hover': {
                                    background: 'rgba(0, 122, 255, 0.08)',
                                    color: '#007AFF',
                                }
                            }}
                        >
                            {!isCollapsed && 'Register'}
                        </Button>
                    </>
                )}
            </Box>
        </Box>
    );
}

export default Navbar;
